import React from 'react';
import '../styles/Exercises.css';

const Exercises = () => {
  const exercises = [
    {
      id: 1,
      name: '4-7-8 Breathing',
      icon: '',
      description: 'Inhale for 4 seconds, hold for 7, exhale for 8 seconds.',
      duration: '5 min'
    },
    {
      id: 2,
      name: 'Box Breathing',
      icon: '',
      description: 'Breathe in 4, hold 4, exhale 4, hold 4. A method used by athletes and professionals.',
      duration: '5 min'
    },
    {
      id: 3,
      name: 'Deep Breathing',
      icon: '',
      description: 'Slow deep breaths to oxygenate your body and release stress naturally.',
      duration: '10 min'
    }
  ];

  return (
    <div className="exercises-page">
      <div className="exercises-container">
        <h1 className="exercises-title">Breathing Exercises</h1>

        <div className="exercises-grid">
          {exercises.map(exercise => (
            <div key={exercise.id} className="exercise-card">
              <div className="exercise-icon-wrapper">
                <span className="exercise-icon">{exercise.icon}</span>
              </div>
              <h2 className="exercise-name">{exercise.name}</h2>
              <p className="exercise-description">{exercise.description}</p>
              <button className="btn-try">Try Now</button>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Exercises;
